import React, {useEffect, useState} from 'react';
import axios from "axios";
import history from "./history";
import Jar from "./Components/Jar";
import Button from "./Components/Buttons";
import Wrapper from "./Components/Wrapper";
import Message from "./Components/Message";
import Title from "./Components/Title";

function openJar() {
    const jarInfo = JSON.parse(localStorage.getItem('jar'));
    return (
        <Wrapper>
            <Title main = {jarInfo.name}/>
            <Button type ="button"  buttonStyle="btn--warning--solid" buttonSize="btn-small"  >Donate</Button>
            <Button type ="button"  buttonStyle="btn--team--solid" buttonSize="btn-small"  >Share</Button>
            <Button type ="button"  buttonStyle="btn--primary--solid" buttonSize="btn-small"  >Rename</Button>
            <Button type ="button"  buttonStyle="btn--danger--solid" buttonSize="btn-small"  >Delete</Button>
        </Wrapper>
    )
}

export default openJar;
